                document.getElementById('ui-mod1').innerText = tP.sync; document.getElementById('ui-mod2').innerText = tP.core;
                document.getElementById('ui-mod3-tag').innerText = tP.controls; document.getElementById('ui-mod4-tag').innerText = tP.chart;
                document.getElementById('ui-mod5').innerText = tP.system + " | " + lD.last_update;
                document.getElementById('ui-asset-label').innerText = tP.select_asset; document.getElementById('ui-lang-label').innerText = tP.select_lang;
                document.getElementById('ui-market-info').innerText = tP.market_info; document.getElementById('ui-entry-label').innerText = tP.entry;
                const ep = (asset === 'eu') ? lD.entry_price_eu : lD.entry_price_dax;
                document.getElementById('entry-data').innerText = ep.toLocaleString() + " @ 09:00";
                let cap = 20000; let curve = []; let days = []; let benchmark = [];
                raw.forEach(r => {
                    let s = 0; if (r.m > t && r.v < 25) s = 1; else if (r.m < -t && r.v < 32) s = -1;
                    let pnl = (asset === 'eu') ? r.p_eu : r.p_dax; let idx = (asset === 'eu') ? r.idx_eu : r.idx_dax;
                    cap += (s * pnl); curve.push(cap); days.push(r.d); benchmark.push(idx);
                });
                document.getElementById('kpi-box').innerHTML = `<div class="text-center p-3 rounded bg-black border border-secondary mt-2"><span class="text-secondary small">${tP.profit}</span><h2 class="${cap >= 20000 ? 'text-success' : 'text-danger'} mt-1">â‚¬ ${ (cap-20000).toLocaleString('it-IT', {maximumFractionDigits: 0}) }</h2></div>`;
                let sig = "FLAT âšª"; if (lD.mom > t && lD.vix < 25) sig = "LONG ðŸŸ¢"; else if (lD.mom < -t && lD.vix < 32) sig = "SHORT ðŸ”´";
                document.getElementById('signal-display').innerText = sig;
                if (chart) chart.destroy();
                chart = new Chart(document.getElementById('main-chart'), {
                    type: 'line', data: { labels: days, datasets: [{ label: tP.equity, data: curve, borderColor: '#238636', borderWidth: 2, pointRadius: 0, fill: true, yAxisID: 'y' }, { label: asset.toUpperCase() + " Index", data: benchmark, borderColor: '#58a6ff', borderWidth: 1, pointRadius: 0, fill: false, yAxisID: 'y1' }] },
                    options: { responsive: true, maintainAspectRatio: false, scales: { x: { ticks: { color: '#8b949e', maxTicksLimit: 10 } }, y: { position: 'left' }, y1: { position: 'right', grid: { drawOnChartArea: false } } } }
                });
            }
            window.onload = run;
        </script>
    </body>
